<P align=center><B><Font size=5>Non-Pitchers on the Mound</Font></B></P>
<P align=center><B><Font size=4>Compiled by David Vincent, David Smith, and Mark Pankin</Font></B></P>

<p>Since the early days of professional baseball, there has been a distinction between pitchers and other players, generally termed "position players."  Occasionally a position player takes the mound, usually due either to a lopsided score and a desire to conserve the pitching staff for another day or a long extra inning game in which most regular pitchers have already been used. We identified all players who appeared in more games as non-pitchers than as pitchers in a season and set a limit of at most eight
times on the mound in a season to be included in the list below.

<p>Shohei Ohtani is one of the reasons for imposing the limit. His dual status has even led to a rules change and it is appropriate to consider him as a pitcher for the purposes of this webpage. With eight as the maximum, several players' seasons have been removed. In chronological order they are Goerge Sisler in 1915 (15 games as a pitcher), Bobby Reis in 1935 (14), Earl Naylor in 1942 (20), Rene Monteagudo in 1945 (14), Jimmie Foxx in 1945 (9), and Johnny O'Brien in 1957 (16).

<P>This page presents the known instances of non-pitchers pitching in a game since 1901. It is a <B>alphabetical</B>
list, and the information is also available as an chronological listing (click <A href="nonpitch-chr.htm">here</A>).
Click on the player's name to see his career page. Click on the date to see the box score and play-by-play, if available. For some of these games, we do not have play by play information and the statistics will be incomplete in those cases.

<p>At the end of the page are some summary tables with the individuals who appear on the list the most often and the years with the most instances.

<p>There is a separate list for players, all before 1906, where we could not identify the games when they pitched. All of the entries on that page are the player's name, season, team and number of games as a pitcher and a position player. Click <A href="nonpitch2.htm">here</A> to see it.

<p>If you know of other instances, please contact the web master.



